import axios from "axios";
import {
  fetchTicketLoading,
  fetchTicketSuccess,
  fetchTicketFail,
} from "./ticketSlice";

export const fetchAllTickets = () => async (dispatch) => {
  dispatch(fetchTicketLoading());

  try {
    const result = await axios.get("http://localhost:3001/v1/ticket", {
      headers: {
        Authorization:
          "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbCI6Im9rb3BAcC5jb20iLCJpYXQiOjE2MjUwNTk0ODksImV4cCI6MTYyNTA2MDM4OX0.kc1mO7Dm261bboCoz7aShZw3CGSEUB9vNjT_BnGubtE",
      },
    });
    dispatch(fetchTicketSuccess(result.data.result));
    if (!result.data.result) {
      dispatch(fetchTicketFail({ message: "error couldn't load" }));
    }
    console.log(result);
  } catch (error) {
    dispatch(fetchTicketFail(error.message));
  }
};
